  render(){
    const playlists = [];
    spotifyApi.getUserPlaylists()
       .then((response) => {
         response.items.map((index) => {
           playlists.push(index.name)
           console.log(playlists)
         })
       });

    const namesList = playlists.map(name => {
      console.log(name)
    })
    return (
      <div>
      <h2 className="name">Name </h2>
      <h2 className="image">Cover</h2>
      </div>
    );
  }
}



